choices.text:
COSBase cosBase = acquireItem( j );
if( cosBase instanceof COSNumber )
{
    result[j] = ((COSNumber)cosBase).floatValue();
}

COSBase cosBase = acquireItem( j );
if (cosBase instanceof COSInteger) {
    result[j] = ((COSInteger)cosBase).intContent();
} else if (cosBase instanceof COSFloat) {
    result[j] = ((COSFloat)cosBase).floatContent();
} else if (cosBase instanceof COSNumber) {
    result[j] = ((COSNumber)cosBase).floatContent();
} else {
    throw new IllegalArgumentException( cosBase.getClass().getName() + " is not a COSInteger, COSFloat, or COSNumber" );
}

